(window.webpackJsonp=window.webpackJsonp||[]).push([[12],{791:function(e,o,t){var content=t(793);"string"==typeof content&&(content=[[e.i,content,""]]),content.locals&&(e.exports=content.locals);(0,t(11).default)("779444aa",content,!0,{sourceMap:!1})},792:function(e,o,t){"use strict";var n=t(791);t.n(n).a},793:function(e,o,t){(o=t(10)(!1)).push([e.i,".bg-title-page[data-v-62353448]{background-image:url(http://dellmat.jim/storage/8.jpg)!important;background-attachment:fixed!important}",""]),e.exports=o},794:function(e,o,t){"use strict";var n={},r=(t(792),t(31)),component=Object(r.a)(n,(function(){var e=this.$createElement;this._self._c;return this._m(0)}),[function(){var e=this.$createElement,o=this._self._c||e;return o("section",{staticClass:"bg-title-page p-t-50 p-b-40 flex-col-c-m"},[o("h2",{staticClass:"l-text2 t-center",staticStyle:{color:"rgb(87, 205, 252)","text-transform":"none"}},[this._v("\n        SW"),o("span",{staticStyle:{color:"#FFF"}},[this._v("APP")])]),this._v(" "),o("p",{staticClass:"m-text13 t-center"},[this._v("\n        Living in the future\n    ")])])}],!1,null,"62353448",null);o.a=component.exports},823:function(e,o,t){var content=t(904);"string"==typeof content&&(content=[[e.i,content,""]]),content.locals&&(e.exports=content.locals);(0,t(11).default)("2d9c1f96",content,!0,{sourceMap:!1})},903:function(e,o,t){"use strict";var n=t(823);t.n(n).a},904:function(e,o,t){(o=t(10)(!1)).push([e.i,".faq-wrapper{max-width:80%!important;margin:auto!important}.accordion__item{border-bottom:1px solid #488fef!important}.accordion[data-v-dd43507e]{border:1px solid #488fef!important}",""]),e.exports=o},951:function(e,o,t){"use strict";t.r(o);var n={components:{myHeader:t(794).a},data:function(){return{myItems:[{title:"How to buy",value:'Buying on {{ process.env.APP_NAME }}.com is as easy as 1, 2, 3, and 4\n                    <br />\n                    <b>Step 1: Login</b>\n                    Locate the Login button to sign in or register.\n                    <br />\n\n                    <b>Step 2: Make your selection</b>\n                    Browse the site for a product of your choice, once you locate it click on it to view its details. If the price is convenient for you, click "Add to cart".\n                    <br />\n\n                    <b>Step 3: View the shopping cart and proceed to checkout</b>\n                    To view, locate the shopping cart button on the top of the site and click on it. Choose either to view the cart or proceed to checkout\n                    <br />\n\n                    <b>Step 4: Add shipping information and make payments</b>\n                    Unable to write correct info of this since an unable to login and proceed to checkout',category:"HELP CENTER"},{title:"Returns & Refunds",value:"Thank you for shopping with us on {{ process.env.APP_NAME }}.com\n                    <br />\n                    In the case that you are not entirely satisfied with your purchase, we’re here to help. Kindly use the following guidelines\n                    ",category:"Returns & Refunds"},{title:"Returns",value:"Being a customer, you are entitled a 48 hours free return after product receipt. After this period the product is guaranteed to be in good condition and this return will not be accepted.\n                    To be eligible for a return, product has to be unused and in the same condition that you received it.\n                    Return is allowed only for defective and wrong items.\n                    Requirements for a valid return\n                    <br />\n                        a. Original manufacturer packaging is required\n                    <br />\n                        b. Have the receipt of proof of purchase\n                    <br />\n                        c. Free promotional items delivered with the purchased product.\n                    <br />\n                    <br />\n\n                    Kindly note:\n                    We do not accept returns for the following items:\n                    <br />\n                        • Products shipped from oversees\n                    <br />\n                        • Undergarments, swimwear, sleepwear\n                    <br />\n                    Customers are always advised to check products carefully during delivery and in the case of a missing item or damaged product kindly return it on the spot.",category:"Returns & Refunds"},{title:"Refunds",value:"Once we have received your returned item we will inspect it and notify you on the status of your refund after the inspection.\n                    <br />\n                    For valid returns we will initiate a refund to your original method of payment.\n                    <br />\n                    For invalid returns, you will receive a call from us explaining the issue before we send back the item(s) to you.",category:"Returns & Refunds"},{title:"Shipping",value:"You will be responsible for paying for your own shipping costs for returning your item. Shipping costs are non­refundable.\n                    <br />\n                    If you receive a refund, the cost of return shipping will be deducted from your refund.\n                    <br />\n                    For further inquiries on how to return your item, kindly contact us.",category:"Returns & Refunds"},{title:"Q1. What is {{ process.env.APP_NAME }} all about?",value:"{{ process.env.APP_NAME }} Group is hoped to dominate the world’s e-commerce market by operating through a unique combination of business models. It will act as a middle man between buyers and sellers only and facilitate the sale of goods between the two parties through its extensive network of website. It will also champion small businesses, in the belief that the internet would level the playing ground by enabling small enterprises to leverage innovation and technology to grow and dominate effectively in the domestic and global economies.",category:"Faqs"},{title:"Q2. Are the products all new & genuine?",value:"Yes, all products listed by sellers on {{ process.env.APP_NAME }} are 100% genuine and original products.",category:"Faqs"},{title:"Q3. What payment methods are available?",value:"There are different payment methods available {{ process.env.APP_NAME }}.  Choose a preferable method for you from the following;<br /><b>Cash on delivery (COD)</b><br /><b>Mobile money (MPESA)</b><br /><b>Online payment (PayPal)</b>",category:"Faqs"},{title:"Q4. Are there hidden charges on purchases?",value:"No, all costs including total amount of the products and shipping fees are clearly indicated at the checkout process.",category:"Faqs"},{title:"Q5. How do I cancel my order?",value:"To cancel an order, please contact us as soon as possible.<br />If order has not yet been shipped, we will immediately refund your payment through payment method used when ordering.<br />If the order has been shipped, we will refund your payments as soon as we have received the item(s) back from you and processed them.",category:"Faqs"},{title:"Q6. Which currencies does {{ process.env.APP_NAME }} accept?",value:"We accept Kenya Shillings (KES) and US Dollars (USD)",category:"Faqs"},{title:"Q7. Do products on {{ process.env.APP_NAME }} come with a warranty?",value:"Warranty sticker will be displayed on the product description page or on the product itself.",category:"Faqs"},{title:"Q8. How do I track my order?",value:"Order status progress is updated via email, once the item has been shipped you can track the order through the provided link.",category:"Faqs"},{title:"Shipping",value:"\n                            The following defines the terms of use of {{ process.env.APP_NAME }}.com website. While standard website rules of use apply, please ensure you have read and understood the information below.\n                    <br />\n\n                    • You must be at least 13 years of age to use this website and no less than 18 years to shop and transact on this website\n                     <br />\n                    • You are solely responsible for protecting your own password, account information or any other personal information while using this website\n                     <br />\n                    • You may only use the website to transact for yourself. If shopping on behalf of a company, full disclosure must be made\n                     <br />\n                    • You may not use this website if you do not agree to the terms and conditions of use\n                     <br />\n                    • You may not use the website to copy, share or distribute any information for any reasons. Permission must be taken from site owners for any such purposes whether legal, public or otherwise\n                     <br />\n                    • The information shared on the website with respect to colors, prices etc may be subject to change or may not be logically accurate where electronic bugs or other inadvertent variables may come into play.\n                     <br />\n                    • You must ensure you check, report any inconsistencies that may affect your use of the website as intended\n                     <br />\n                    • The logo, information and all content shared on the website remains the intellectual property of {{ process.env.APP_NAME }}.com\n                     <br />\n                    • {{ process.env.APP_NAME }} takes no responsibility for the accuracy or use of information accessed or shared via external links to other sites from this website\n                     <br />\n\n                The owners and managers of this site reserve the right to terminate any account or transaction that may be ethically, legally or otherwise be in violation of the above or general stated terms of use.\n                Where applicable, both local Kenyan Law as well as international laws on website/internet use of information govern legal matters pertaining to this website.\n                                    <br />\n                Changes may be made to information on this and any other pages without prior notice to users. We will do our best to communicate any important changes as and when they are made in a clear, visible manner on this site or via email.\n                            ",category:"Terms and conditions"},{title:"1. Privacy Policy",value:"{{ process.env.APP_NAME }}, is committed to making your search for the perfect product as simple and comfortable as possible. Respecting your privacy is an extension of this service and this policy outlines the types and use of information that you have shared with us as part of using our online services.<br />In continuing to use this website, you agree to the collection, use and selective disclosure of your personally identifiable information as described below. If you do not agree to the terms of this Privacy Policy, please do not continue to use this website.",category:"PRIVACY POLICY"},{title:"2. What type of information do we collect?",value:"<b>Personal Information</b><br />Personal information is information that specifically identifies you as an individual, such as your name, address, telephone number, e–mail address, credit card or other account number, as well as information about your activities, such as your purchases. Personal information also includes demographic information, such as date of birth, gender, geographic area and preferences when such information is linked to other personal information that identifies you.<br /><br /><br />\n                    <strong>Non-personal Information.</strong>\n                    <br />\n                    As part of the standard operation of this website, we may collect certain non-personal information from your use of the site, including, but not limited to your Internet IP address, browser type, domain, access device, referring website addresses, date, time and duration of visit by page, return visit frequency and other information on your browsing behavior. This data serves to help us understand trends and customer needs so that we can improve our products and services to enhance your shopping experience.\n                    ",category:"PRIVACY POLICY"},{title:"3. When do we collect this information?",value:"We only collect personal information from you when you <br />\n                    1) Register on the {{ process.env.APP_NAME }} website and create an account, including any account created using already established social networking accounts such as Facebook  <br />\n                    2) Complete a survey.  <br />\n                    3) Sign up for our e-mail list, offers, promotions or newsletter.  <br />\n                    4) Share content from this website with your friends and family.  <br />\n                    5) Contact us by e-mail or by using the chat feature for any reason.  <br />\n                    6) Order products and services.  <br /> <br />\n                    This website is intended for general audience and not directed to children less than 18 years of age and we do not knowingly collect personal information from children under 18 years of age.\n\n                    ",category:"PRIVACY POLICY"},{title:"4. How do we collect your information?",value:'<b>COOKIES</b> <br />\n                    A cookie is a small text file that may be stored on the hard drive of your computer when you access the website. A "session cookie" expires immediately when you end your session (i.e., close your browser). A "persistent cookie" stores information on the hard drive so when you end your session and return to the same website at a later date, the cookie information is still available. When you visit our website, we may use both a session and a persistent cookie. These cookies may contain information (such as a unique user ID) that is used to track your usage of our website and in some cases, your e-mail address. Your e- mail address is only saved in this cookie if you register with us.\n                    <br />When you register with us, this cookie allows us to recognize you when you return to our website and provides you with access to your account information. If you save your information with or order from us, we may also use cookies to monitor and maintain information about your use of our website.\n                    <br /><br />\n                         If you have not saved your information with or ordered from us, we may monitor and maintain information about your use of our website in a manner that does not identify you. We may use cookies to collect the non-personal information described above in order to: <br />\n                        1) Provide you with customized content and advertising<br />\n                        2) Monitor website usage<br />\n                        3) Conduct research to improve our content and services.<br />\n                        You are free to decline cookies, but by doing so, you may not be able to use certain features on this website or take full advantage of all our offerings. Check the “Help” menu of your browser to learn how to change your cookie preferences.\n                        <br />\n                        <br />\n                        <strong>PIXEL TAGS</strong>\n                        A pixel tag (also known as a web beacon) is a small string of code that represents a clear graphic image and is used in conjunction with a cookie. A pixel tag allows us to capture certain additional types of information about a visitor\'s actions on a web site, such as a visitor\'s cookie number, the time, date, duration and number of page views, a description of the page where the tag is placed and details about any items that were purchased. Pixel tags help us analyze our customers\' online behavior and measure the effectiveness of our website and our advertising. We work with service providers that help us track, collect and analyze this information.\n                        <br />\n                        <strong>CLICKSTREAM DATA</strong>\n                        Clickstream data is a record of your activity on the Internet. This data is recorded whenever you click anywhere in a webpage or application and is used for the purposes of collecting, analyzing and reporting data about how you use the Site. This method of data collection is used to capture non-personal information.\n                       ',category:"PRIVACY POLICY"},{title:"5. How do we use the information?",value:"We may share your personal information across our departments, affiliate and subsidiary companies in order to improve your shopping experience on this website. At other times, we may also share your personal information with service providers and other third parties that need access to your personal information to provide us with operational or other support services, such as payment processors, shipping agents, other vendors and fraud prevention service providers, or for marketing research analytics. {{ process.env.APP_NAME }}.com takes steps to ensure that the third parties agree to appropriate restrictions on the disclosure and use of your information. Unless otherwise disclosed to you, these third parties are prohibited from using your personal information for their own marketing purposes. We do not rent or sell your personal information to marketers outside of our network and partners, unless indicated in this Privacy Policy or you otherwise authorize us to do so.\n                    <br/>\n                    We may also use your personal and non-personal information collected for the following purposes:\n                    <br/>\n\n                    1) to fulfill your requests for products and services; <br/>\n                    2) to provide you with targeted offers and advertising; <br/>\n                    3) to contact you with information, promotions from {{ process.env.APP_NAME }} as well as from our subsidiaries, affiliates, marketing partners, advertisers and other third parties; <br/>\n                    4) to contact you if there is a problem with your order; <br/> 5) to ask you to review your in-store experience with us; <br/> 6) to review this website’s usage and operations; <br/>\n                    7) to conduct marketing research in order to optimize our search engine marketing strategies; and\n                    8) to guard against fraud, we may verify and/or supplement your personal information with information from third party sources.\n\n                    <br/>\n                    In addition, we reserve the right to further use or disclose any information without notice or consent to the following entities for the following purposes: <br/>\n                    1) to our employees, independent contractors, subsidiaries, affiliates, consultant, business associates, service providers and suppliers, if the disclosure will enable any of these entities to perform a business, professional or technical support function for us; <br/>\n                    2) to our employees, independent contractors, service providers and suppliers, to fulfill a product or service request; <br/>\n                    3) as necessary if we believe that there has been a violation of the website’s Terms of Use or of our rights or the rights of any third party; <br/>\n                    4) to respond to judicial process and provide information to law enforcement agencies or in connection with an investigation on matters related to public safety, as permitted or as required by law; <br/>\n                    5) to conduct investigations of consumer complaints or fraud <br/>\n                    ",category:"PRIVACY POLICY"},{title:"6. How secure is our site?",value:'     We take your security when using this website, very seriously. We have taken certain physical, electronic, contractual and managerial steps to safeguard and secure the information we collect from the website\n                    users. We limit the access to private and confidential data to only employees with a specific need to retrieve this information. To maintain this level of security, we do not store private information on the website. We do not direct the website to, nor do we knowingly collect, any personal information from children under the age of eighteen.\n                    <br />\n                    All of your information is encrypted before it is transmitted across the Internet. Additionally, the information you provide when you place an order is encrypted (or coded) using a secure server for maximum security. This coding makes it extremely difficult for anyone to reach your information as it moves through our ordering system.\n                    <br />\n                    Most of the pages on our site provide information about our company, our products and do not contain secure information. This information is available freely and there\'s no reason for these pages to be secure. Pages like "Checkout area" and pages on which you actually make a purchase, manage your account, or check your order status are made secure. This means, the entire checkout process, from introduction to final confirmation, is completely secure. When confirming an order, the confirmation page will display your shipping address, billing address, and payment method (e.g. credit card, Mpesa). Your credit card number will not be displayed on this page. When you are logged into your account, your profile page will display the last four digits of the credit card you have on file. It will not display your full credit card number. New credit card information may be added or current credit card information deleted, but you will not be able to edit any of your credit card information.\n                    <br />\n                    When you create an account on our site, we will store some of your personal information. This will include your name, login information (except passwords), shipping address, billing address, order information, wish list information, and payment settings Should you log in using a social media site such as Facebook, we will capture and store that login information as well.\n                    <br />\n                    To check if your computer is secure, look for a padlock to either the left or right of the URL. If you see a closed padlock, then the encryption technology is active and the server is secure. You can also check by looking at the URL line of your browser. When you access a secure server, the initial characters of the site address will be "https."\n                    <br />\n                    By use of this website, you also have an obligation to safeguard your own personal information. It is your responsibility to ensure that your password and profile information is kept confidential, when you sign up for an account on this website. The best passwords use complex characters with unique number, letters and special characters. Always make sure you log out before leaving this website. Change your password in case you believe it has been compromised.',category:"PRIVACY POLICY"},{title:"7. Third-Party Websites & Advertising",value:'     This website may contain links to third-party websites, which may have privacy policies that differ from our own. We are not responsible for the activities and practices that take place on these sites. Accordingly, we recommend that you review the privacy policy posted on any site that you may access through our website.\n                    <br />\n                    From time to time we use third-party service providers to serve advertisements (banners or links) on our behalf across the Internet.\n                    <br />\n                    These advertising service providers may collect non-identifiable information about your visits to our website, and your interactions with our products and services. Such non-identifiable information does not include your name, address, e-mail address or other personal information. The information is collected through the use of cookies and pixel tags.\n                    <br />\n                    In addition to the information about your visits to our website, our service providers may also use the information about your visits to other websites to target advertisements for products and services available from {{ process.env.APP_NAME }}.com\n                    Currently, we use third party-placed tracking pixels and cookies from the following advertising delivery partners: Google Ad Display Network, In the future we may partner with other companies to provide interest-based advertising, both on and off this website. You are at any time free to manage your third-party advertising preferences by clicking on the links below:\n                    <br />\n                    If you would like more information about this practice and to know your choices for not having this information used by third-party service providers, please\n                    visit <a href="http://www.networkadvertising.org/managing/opt_out.asp" target="_blank">http://www.networkadvertising.org/managing/opt_out.asp</a>\n                    <br />\n                    <b>FACEBOOK CUSTOM AUDIENCE ADS</b>\n                    We work with Google Ad Network to help us personalize our ads based on your shopping experience and interests across the internet. You can opt out of this ad match at any time by managing your ad preferences on Google.\n                    <br />\n                    <b>GOOGLE CUSTOM MATCH ADS</b>\n                    We work with Google Ad Network to help us personalize our ads based on your shopping experience and interests across the internet. You can opt out of this ad match at any time by managing your ad preferences on Google.\n                    <br />\n                    <b>EMAIL MARKETING</b>\n                    When you opt in by subscribing to our newsletters, offers and promotions, you receive marketing e-mails from us from time to time. Should you wish to unsubscribe, you can do so by clicking on the Unsubscribe hyperlink at the bottom of the marketing e-mail you receive. Your record may still remain in our database but you will not receive any future mailings from us.\n                    You can also opt out of e-mails by sending an e-mail to us at <a href="mailto:info@dellmat.com" target="_blank">info@dellmat.com</a>  requesting us to unsubscribe a specific e-mail address.',category:"PRIVACY POLICY"},{title:"8. Changes to this Privacy Policy",value:'We may change this Privacy Policy from time to time. Any significant changes will be posted online or shared with you via email. We will do our best to give ample notice for changes that affect you or the information, use of information you may have provided us with.\n                    <br />\n                    If you have any questions or concerns about this Privacy Policy, please contact us at <a href="mailto:info@dellmat.com" target="_blank">info@dellmat.com</a>.',category:"PRIVACY POLICY"}]}},mounted:function(){$nuxt.$emit("ScollTopEvent")}},r=(t(903),t(31)),component=Object(r.a)(n,(function(){var e=this,o=e.$createElement,t=e._self._c||o;return t("div",[t("myHeader"),e._v(" "),e._m(0),e._v(" "),t("el-collapse",{staticClass:"container",attrs:{accordion:""}},e._l(e.myItems,(function(o,n){return t("el-collapse-item",{key:n,attrs:{name:n+1}},[t("template",{slot:"title"},[e._v("\n            "+e._s(o.title)),t("i",{staticClass:"header-icon el-icon-info"})]),e._v(" "),t("div",[e._v(e._s(o.value))])],2)})),1)],1)}),[function(){var e=this.$createElement,o=this._self._c||e;return o("div",{staticClass:"box-title",staticStyle:{margin:"30px 0"}},[o("h3",[o("span",[this._v("FAQS")])])])}],!1,null,null,null);o.default=component.exports}}]);